INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (24001, 1, 126001, 0, 2, 325, 5, 40011, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, "クリア");
